  function roll(id, threadNum, min = 0, max = 100) {
    const seed = parseInt(id, 16) + parseInt(threadNum);

    // Simple pseudo-random generator (Mulberry32)
    function mulberry32(a) {
      return function () {
        a |= 0; a = a + 0x6D2B79F5 | 0;
        var t = Math.imul(a ^ a >>> 15, 1 | a);
        t = t + Math.imul(t ^ t >>> 7, 61 | t) ^ t;
        return ((t ^ t >>> 14) >>> 0) / 4294967296;
      };
    }

    const rand = mulberry32(seed)();
    return Math.floor(rand * (max - min + 1)) + min;
  }

  function averageHexColor(hexArray) {
    if (hexArray.length === 0) return null;

    let totalR = 0, totalG = 0, totalB = 0;

    for (const hex of hexArray) {
      const rgb = hexToRgb(hex);
      totalR += rgb.r;
      totalG += rgb.g;
      totalB += rgb.b;
    }

    const avgR = Math.round(totalR / hexArray.length);
    const avgG = Math.round(totalG / hexArray.length);
    const avgB = Math.round(totalB / hexArray.length);

    const toHex = val => val.toString(16).padStart(2, '0');

    return `${toHex(avgR)}${toHex(avgG)}${toHex(avgB)}`;
  }

  //============== Color spells

  function srgbToLinear(c) {
    c = c / 255;
    return c <= 0.04045 ? c / 12.92 : Math.pow((c + 0.055) / 1.055, 2.4);
  }

  function rgbToXyz({ r, g, b }) {
    r = srgbToLinear(r);
    g = srgbToLinear(g);
    b = srgbToLinear(b);
    return {
      x: r * 0.4124 + g * 0.3576 + b * 0.1805,
      y: r * 0.2126 + g * 0.7152 + b * 0.0722,
      z: r * 0.0193 + g * 0.1192 + b * 0.9505
    };
  }

  function xyzToLab({ x, y, z }) {
    const refX = 0.95047, refY = 1.00000, refZ = 1.08883;
    x /= refX; y /= refY; z /= refZ;
    const f = t => t > 0.008856 ? Math.cbrt(t) : (7.787 * t + 16 / 116);
    return {
      L: 116 * f(y) - 16,
      a: 500 * (f(x) - f(y)),
      b: 200 * (f(y) - f(z))
    };
  }

  function rgbToLab(rgb) {
    return xyzToLab(rgbToXyz(rgb));
  }

  function cieDE2000(rgb1, rgb2) {
    const lab1 = rgbToLab(rgb1);
    const lab2 = rgbToLab(rgb2);

    const deg2rad = Math.PI / 180;
    const rad2deg = 180 / Math.PI;

    const L1 = lab1.L, a1 = lab1.a, b1 = lab1.b;
    const L2 = lab2.L, a2 = lab2.a, b2 = lab2.b;

    const avgL = (L1 + L2) / 2;
    const C1 = Math.sqrt(a1 * a1 + b1 * b1);
    const C2 = Math.sqrt(a2 * a2 + b2 * b2);
    const avgC = (C1 + C2) / 2;

    const G = 0.5 * (1 - Math.sqrt(Math.pow(avgC, 7) / (Math.pow(avgC, 7) + Math.pow(25, 7))));
    const a1p = a1 * (1 + G);
    const a2p = a2 * (1 + G);

    const C1p = Math.sqrt(a1p * a1p + b1 * b1);
    const C2p = Math.sqrt(a2p * a2p + b2 * b2);
    const avgCp = (C1p + C2p) / 2;

    const h1p = Math.atan2(b1, a1p) * rad2deg;
    const h2p = Math.atan2(b2, a2p) * rad2deg;
    const h1pMod = h1p >= 0 ? h1p : h1p + 360;
    const h2pMod = h2p >= 0 ? h2p : h2p + 360;

    let deltahp;
    if (Math.abs(h1pMod - h2pMod) <= 180) {
      deltahp = h2pMod - h1pMod;
    } else if (h2pMod <= h1pMod) {
      deltahp = h2pMod - h1pMod + 360;
    } else {
      deltahp = h2pMod - h1pMod - 360;
    }

    const deltaLp = L2 - L1;
    const deltaCp = C2p - C1p;
    const deltaHp = 2 * Math.sqrt(C1p * C2p) * Math.sin((deltahp * deg2rad) / 2);

    const avgHp = (Math.abs(h1pMod - h2pMod) > 180)
      ? (h1pMod + h2pMod + 360) / 2
      : (h1pMod + h2pMod) / 2;

    const T =
      1 -
      0.17 * Math.cos(deg2rad * (avgHp - 30)) +
      0.24 * Math.cos(deg2rad * (2 * avgHp)) +
      0.32 * Math.cos(deg2rad * (3 * avgHp + 6)) -
      0.20 * Math.cos(deg2rad * (4 * avgHp - 63));

    const deltaTheta = 30 * Math.exp(-Math.pow((avgHp - 275) / 25, 2));
    const Rc = 2 * Math.sqrt(Math.pow(avgCp, 7) / (Math.pow(avgCp, 7) + Math.pow(25, 7)));
    const Sl = 1 + ((0.015 * Math.pow(avgL - 50, 2)) / Math.sqrt(20 + Math.pow(avgL - 50, 2)));
    const Sc = 1 + 0.045 * avgCp;
    const Sh = 1 + 0.015 * avgCp * T;
    const Rt = -Math.sin(2 * deg2rad * deltaTheta) * Rc;

    return Math.sqrt(
      Math.pow(deltaLp / Sl, 2) +
      Math.pow(deltaCp / Sc, 2) +
      Math.pow(deltaHp / Sh, 2) +
      Rt * (deltaCp / Sc) * (deltaHp / Sh)
    );
  }

  function hexToRgb(hex) {
    const bigint = parseInt(hex, 16);
    return {
      r: (bigint >> 16) & 255,
      g: (bigint >> 8) & 255,
      b: bigint & 255
    };
  }

  //=====================================

  function addImg(idElem) {
    const id = idElem.textContent.trim().substr(0, 6);

    if (!id)
      return;

    const group = findClosestGroupForColor(id, ASSIGNMENT_THRESHOLD);
    let c = null;

    if (!group)
      c = colorMap.random[roll(id, thread.refreshParameters.threadId, 0, colorMap.random.length - 1)];
    else if (group.base.length === 1)
      c = group.base[0];
    else
      c = group.base[roll(id, thread.refreshParameters.threadId, 0, group.base.length - 1)];

    if (!c)
      return;

    var img = document.createElement('IMG');
    img.src = c.img;
    img.style.width = "15px";
    img.style.verticalAlign = 'bottom';
    img.title = c.name;
    idElem.parentNode.insertBefore(img, idElem);
  }

  function groupColors(baseColors, threshold) {
    const groups = [];
    const ungrouped = [...baseColors.filter(c => !c.forceNoGroup)];

    while (ungrouped.length) {
      const group = [];
      const toCheck = [ungrouped.pop()];

      while (toCheck.length) {
        const current = toCheck.pop();
        group.push(current);

        for (let i = ungrouped.length - 1; i >= 0; i--) {
          const candidate = ungrouped[i];
          const thresholdValue = current.groupThreshold ?? candidate.groupThreshold ?? threshold;

          const dist = cieDE2000(
            hexToRgb(current.color),
            hexToRgb(candidate.color)
          );

          if (dist <= thresholdValue) {
            toCheck.push(candidate);
            ungrouped.splice(i, 1);
          }
        }
      }

      groups.push({ base: group });
    }

    for (let g of [...baseColors.filter(c => c.forceNoGroup)])
      groups.push({ base: [g] });

    return groups;
  }

  function findClosestGroupForColor(colorId, colorThreshold) {
    const rgb = hexToRgb(colorId);
    let closestGroup = null;
    let closestDistance = Infinity;
    let thresholdForClosestGroup = colorThreshold;

    for (const group of groups) {
      if (group.isSpecial) continue;

      const avgHex = averageHexColor(group.base.map(c => c.color));
      const baseRgb = hexToRgb(avgHex);
      const dist = cieDE2000(rgb, baseRgb);

      const minThreshold = Math.min(...group.base.map(c => c.colorThreshold ?? colorThreshold));

      if (dist < closestDistance) {
        closestDistance = dist;
        closestGroup = group;
        thresholdForClosestGroup = minThreshold;
      }
    }

    if (closestDistance <= thresholdForClosestGroup) {
      return closestGroup;
    }

    return null;
  }

  const groups = groupColors(colorMap.colors, COLOR_SIMILARITY_THRESHOLD);

  const ids = document.getElementsByClassName('labelId');
